int value = 11;
        for (int i = 0; i < value / 2; i++) {
            for (int j = 0; j < value - i; j++) {
                if(j < i) {
                    System.out.print(" ");
                } else {
                    System.out.print("*");
                }
            }
            System.out.println();
        }
        for (int i = value / 2; i >= 0; i--) {
            for (int j = 0; j < value - i; j++) {
                if(j < i) {
                    System.out.print(" ");
                } else {
                    System.out.print("*");
                }
            }
            System.out.println();
        }

